<script>
//https://davidwalsh.name/browser-camera
// Grab elements, create settings, etc.
var video = document.getElementById('video');

// Get access to the camera!
if(navigator.mediaDevices && navigator.mediaDevices.getUserMedia) {
    // Not adding `{ audio: true }` since we only want video now
    navigator.mediaDevices.getUserMedia({ video: true }).then(function(stream) {
		video.srcObject=stream;
        video.play();
    });
}

// Crop video to get test images to feed into nodel
var outputWidth = imageSize;
var outputHeight = imageSize;
// define top and left of crop box
var cropTop = 55;
var cropLeft = 90;
// define frequency of sampling
var dx = 7;
var dy = 5;
// display the crop overlay on video
var displayCrop = false;

// Update canvas every n milliseconds
// Baseline date to determine timer
var then = new Date().getTime();
function updateCanvas() {
	var now = new Date().getTime();
	if ((now - then) > 100) { // update every {how many} miliseconds
		var testCTXImageData = resizeCanvas();
		if (totalCurrentPixel > 100000) { // classify only if screen is bright
			classifyCanvas(testCTXImageData);
		} else { // don't classify if screen is dark
			document.getElementById('spanOutput').innerHTML = "No Image";
			document.getElementById('divResult').style.backgroundColor = "black";
			document.getElementById('spanOutputOverlay').innerHTML = "";
			document.getElementById('spanChart').innerHTML = "";
		}
		then = now;
		}
	requestAnimationFrame(updateCanvas); // call requestAnimationFrame again to animate next frame
}

var totalCurrentPixel = 0; //to disable classify if no US image
function resizeCanvas() {
	//var imageSource = document.getElementById('imageSource');
	var imageSource = document.getElementById('video');
	var canvasResize = document.getElementById('canvasResize');
	canvasResize.width = imageSource.width;
	canvasResize.height = imageSource.height;
	var ctxResize = canvasResize.getContext('2d');
	ctxResize.drawImage(imageSource, 0, 0);
	var ctxResizeImageData = ctxResize.getImageData(0, 0, canvasResize.width, canvasResize.height);

	var testCanvas = document.getElementById('testCanvas');
	testCanvas.width = outputWidth;
	testCanvas.height = outputHeight;
	var testCTX = testCanvas.getContext('2d');
	var testCTXImageData = testCTX.getImageData(0, 0, outputWidth, outputHeight);
	var resizedImageData = testCTXImageData.data;

	totalCurrentPixel = 0; //to disable classify if no US image
	var i = 0;
	for (var y = 0; y < outputHeight; y++) {
		for (var x = 0; x < outputWidth; x++) {
			var currentPixel = ctxResizeImageData.data[ ((canvasResize.width * (cropTop + Math.round(y * dy))) + (cropLeft + Math.round(x * dx))) * 4];
			totalCurrentPixel += currentPixel; //to disable classify if no US image
			if (displayCrop) {
				//draw red dots on sampled pixels
				ctxResizeImageData.data[ ((canvasResize.width * (cropTop + Math.round(y * dy))) + (cropLeft + Math.round(x * dx))) * 4] = 255;
			}
			resizedImageData[i] = currentPixel;
			resizedImageData[i+1] = currentPixel;
			resizedImageData[i+2] = currentPixel;
			resizedImageData[i+3] = 255;
			i += 4;
		}
	}
	if (displayCrop) {
		//redraw the canvas to display the sample pixels as red dots
		ctxResize.putImageData(ctxResizeImageData, 0, 0);
	}

	testCTXImageData.data = resizedImageData;
	testCTX.putImageData(testCTXImageData, 0, 0);
	return(testCTXImageData);
}

function toggleDisplayCrop() {
	if (displayCrop) { 
		displayCrop = false; 
		document.getElementById('divCanvas').style.display = "none";
	} else { 
		displayCrop = true;
		document.getElementById('divCanvas').style.display = "block";
		}
}

</script>

function classifyCanvas(testCTXImageData) {

	//PREDICT
	//initiate testing volume at imageSizevximageSizex1 prefilled with 0.0
	var tvol = new convnetjs.Vol(imageSize, imageSize, 1, 0.0);

	var testVol = [];
	//get dimensionless imagedata
	for (var i = 0; i < testCTXImageData.data.length / 4; i++) {
		testVol[i] = testCTXImageData.data[i * 4]; //assume grayscale, only use R channel
	}

	//fill testing volume with dimensionless imagedata of test volumes
	var p = 0;
	for (var yc = 0; yc < imageSize; yc++) {
		for (var xc = 0; xc < imageSize; xc++) {
			tvol.set(xc, yc, 0, testVol[p]);
			p++;
		}
	}

	var prediction = net.forward(tvol);
	
	//pick the label with the highest score
	var highestWeight = 0;
	var highestWeightedOrgan = null;
	for (var o = 0; o < organ.length; o++) {
		if (prediction.w[o] > highestWeight) {
			highestWeight = prediction.w[o];
			highestWeightedOrgan = o;
		}
	}
	var predictionLabel = organ[highestWeightedOrgan];
	var predictionColor = chartColors[highestWeightedOrgan];	
	
	document.getElementById('spanOutput').innerHTML = predictionLabel;
	document.getElementById('divResult').style.backgroundColor = predictionColor;
	document.getElementById('spanOutputOverlay').innerHTML = predictionLabel;
	
	//draw chart
	var spanChartHTML = " ";
	var maximumWidth = 150;
	for (var o = 0; o < organ.length; o++) {
		//rename gallbladder and bladder in bar chart
		if (organ[o] == "gallbladder") {
			var organText = "GB";
		} else
		if (organ[o] == "bladder") {
			var organText = "UB";
		} else {
			var organText = organ[o];
		}
			
		spanChartHTML += "<div style=\"display: inline-block; width: 50px;\">" + organText + "</div>";
		spanChartHTML += "<div style=\"display: inline-block; width: " + Math.round(prediction.w[o] * maximumWidth) + "px; background-color: " + chartColors[o] + "\">&nbsp	</div>";
		spanChartHTML += "<div style=\"display: inline-block;\">" + prediction.w[o].toFixed(2) + "</div><br>";
	}
	document.getElementById('spanChart').innerHTML = spanChartHTML;
}
